import React from 'react'
import Avatar from '@material-ui/core/Avatar';
import Picture from '../../../assests/images/Ray.jpg'
import { Grid } from '@material-ui/core';

const avatar = () => {
    const classes = {
        bigAvatar: {
            margin: '10px',
            width: '150px',
            height: '60px',
      }
    };
    return (
        <Grid container justify="left" alignItems="center">
            <Avatar alt="Ricky ProfPic" src={Picture} style={classes.bigAvatar} ></Avatar>
        </Grid>
    )
}

export default avatar
